import * as React from "react";
import { Button, View, Text } from "react-native";


export function Apim({ navigation }) {
    
  return (
      
    <View  style={{
        flex: 1,
        justifyContent: "center",
        backgroundColor: "#161b22",
        flexDirection: "column",
      }}>
          
      <Text>merhaba</Text>
 
    </View>
  );
}
